import React from "react";

const CustomInput = ({ label, value, setValue }) => {
  return (
    <div>
      <label>{label}</label>
      <input
        style={{ width: "100%" }}
        value={value}
        onChange={(e) => setValue(e.target.value)}
      />
    </div>
  );
};

export default CustomInput;
